import React from "react";
import { SearchTabContainer, InputWrapper, SearchInput, SearchIcon } from "./SearchTab.styles";

const SearchTab: React.FC = () => {
  return (
    <SearchTabContainer>
      <InputWrapper>
        <SearchInput placeholder="제목을 입력해주세요." />
        <SearchIcon />
      </InputWrapper>
    </SearchTabContainer>
  );
};

export default SearchTab;
